```ts
declare module 'socket.io' {
	export = SocketIO;
}
```
like [@types/socket.io-client](https://github.com/DefinitelyTyped/DefinitelyTyped/blob/master/types/socket.io-client/index.d.ts#L8)

allow pathch `SocketIO` using `declare global` like this

```ts
type Convert<T> = {
  [k in keyof T]: T[k] extends { new(): infer R }
  ? R
  : T[k]
}
namespace entities
{
  export class Type { }
  export class Image { }
  export class State { }
}
namespace Protocol
{
  export var types: entities.Type[]
  export var images: entities.Image[]
  export var states: entities.State[]
}
type keys = keyof Convert<typeof Protocol>
type data<k extends keys> = Convert<typeof Protocol>[k]
type emiter<k extends keys> = [k, data<k>]
type resiver<k extends keys> = [k, (data: data<k>) => void]


//#region patch `socket.io`
declare global
{
  namespace SocketIO
  {
    interface Namespace { }
    interface Server
    {
      emit<k extends keys>(...args: emiter<k>): Namespace
      // on<k extends keys>(...args: resiver<k>): Namespace
    }
    interface Socket
    {
      emit<k extends keys>(...args: emiter<k>): NodeJS.EventEmitter
      on<k extends keys>(...args: resiver<k>): NodeJS.EventEmitter
      off<k extends keys>(key: k, f: Function): NodeJS.EventEmitter
      removeAllListeners<k extends keys>(key: k): NodeJS.EventEmitter
    }
  }
}
let io: SocketIO.Server
io.on('connect', socket =>
{
  socket.on('images', data => { }) // (parameter) data: entities.Image[]
  socket.on('states', data => { }) // (parameter) data: entities.State[]
})
```

